import React from "react";

export default function ListMusicAdmin({
  music: { musicName, musicAuthor, musicImg, musicFile },
}) {
  function editMussic() {
    const popUpEdit = document.querySelector(".edit-popup");
    popUpEdit.classList.add("active");
  }

  return (
    <div className="like">
      <img className="img" src={musicImg} alt="" />
      <h5 className="name">{musicName}</h5>
      <h5 className="author">{musicAuthor}</h5>
      <audio
        className="audio"
        src="/music/khong_loi/acoustic/bensound-acousticbreeze.mp3"
      />
      <button className="item-create edit" onClick={editMussic}>
        Edit
      </button>
      <button className="item-create delete">Delete</button>
    </div>
  );
}
